import { useEffect } from "react";
import Post from "../Post";

export default function İndexPage() {
  const [post, setPost] = useState([]);
  useEffect(() => {
    fetch("http://localhost:4000/post").then((response) => {
      response.json().then((posts) => {
        setPosts(posts);
      });
    });
  }, []);
  return (
    <>
      {post.length > 0 && posts}
    </>
  )
}
